import "./App.css";
import { useState } from "react";

function App() {
  const [nombre, setNombre] = useState("");
  const [edad, setEdad] = useState(0);
  const [pais, setPais] = useState("");
  const [cargo, setCargo] = useState("");
  const [anios, setAnios] = useState(0);

  const mostrarDatos = () => {
    alert(nombre);
  }
  return (
    <div className="App">
      <div className="datos">
        <h2>Datos Personales</h2>
        <label>
          Nombre(s):{" "}
          <input
            onChange={(event) => {
              setNombre(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Apellido Paterno:{" "}
          <input
            onChange={(event) => {
              setNombre(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Apellido Materno:{" "}
          <input
            onChange={(event) => {
              setNombre(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Edad:{" "}
          <input
            onChange={(event) => {
              setEdad(event.target.value);
            }}
            type="number"
          />
        </label>
        <label>
          Calle:{" "}
          <input
            onChange={(event) => {
              setPais(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Colonia:{" "}
          <input
            onChange={(event) => {
              setPais(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Código Postal:{" "}
          <input
            onChange={(event) => {
              setPais(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Municipio:{" "}
          <input
            onChange={(event) => {
              setPais(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Estado:{" "}
          <input
            onChange={(event) => {
              setPais(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Número Interior:{" "}
          <input
            onChange={(event) => {
              setAnios(event.target.value);
            }}
            type="number"
          />
        </label>
        <label>
          Pais:{" "}
          <input
            onChange={(event) => {
              setCargo(event.target.value);
            }}
            type="text"
          />
        </label>

        <button onClick={mostrarDatos}>Registrar</button>
      </div>
    </div>
  );
}

export default App;
